import { Box, Typography, useTheme, useMediaQuery } from "@mui/material";

const LoginPage = () => {
  const theme = useTheme();
  const isNonMobileScreens = useMediaQuery("(min-width:1000px)");
  return (
    <Box>
      <Box>
        <Typography
          fontWeight="bold"
          fontSize="clamp(1rem,2rem,2.25rem)"
          color="primary"
          sx={{
            "&:hover": {
              color: primarylight,
              cursor: "pointer",
            },
          }}
        >
          Sociopedia
        </Typography>
      </Box>
    </Box>
  );
};

export default LoginPage;
